"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[6322],{9520:e=>{e.exports=JSON.parse('{"label":"Arrays","permalink":"/docs/tags/arrays","allTagsPath":"/docs/tags","count":20,"items":[{"id":"medium/array_of_products","title":"Array Of Products","description":"Write a function that takes in a non-empty array of integers and returns an array of the same length, where each element in the output array is equal to the product of every other number in the input array.","permalink":"/docs/medium/array_of_products"},{"id":"medium/best_seat","title":"Best Seat","description":"You walk into a theatre you\'re about to see a show in. The usher within the theatre walks you to your row and mentions you\'re allowed to sit anywhere within the given row. Naturally you\'d like to sit in the seat that gives you the most space. You also would prefer this space to be evenly distributed on either side of you (e.g. if there are three empty seats in a row, you would prefer to sit in the middle of those three seats).","permalink":"/docs/medium/best_seat"},{"id":"medium/first_duplicate_value","title":"First Duplicate Value","description":"Given an array of integers between 1 and n, inclusive, where n is the length of the array, write a function that returns the first integer that appears more than once (when the array is read from left to right).","permalink":"/docs/medium/first_duplicate_value"},{"id":"medium/longest_peak","title":"Longest Peak","description":"Write a function that takes in an array of integers and returns the length of the longest peak in the array.","permalink":"/docs/medium/longest_peak"},{"id":"medium/majority_element","title":"Majority Element","description":"Write a function that takes in a non-empty, unordered array of positive integers and returns the array\'s majority element without sorting the array and without using more than constant space.","permalink":"/docs/medium/majority_element"},{"id":"medium/merge_overlapping_intervals","title":"Merge Overlapping Intervals","description":"Write a function that takes in a non-empty array of arbitrary intervals, merges any overlapping intervals, and returns the new intervals in no particular order.","permalink":"/docs/medium/merge_overlapping_intervals"},{"id":"medium/missing_number","title":"Missing Numbers","description":"You\'re given an unordered list of unique integers nums in the range [1, n], where n represents the length of nums + 2. This means that two numbers in this range are missing from the list.","permalink":"/docs/medium/missing_number"},{"id":"medium/monotonic_array","title":"Monotonic Array","description":"Write a function that takes in an array of integers and returns a boolean representing whether the array is monotonic.","permalink":"/docs/medium/monotonic_array"},{"id":"medium/move_element_to_end","title":"Move Element To End","description":"You\'re given an array of integers and an integer. Write a function that moves all instances of that integer in the array to the end of the array and returns the array.","permalink":"/docs/medium/move_element_to_end"},{"id":"easy/non_constructible_change","title":"Non-Constructible Change","description":"Given an array of positive integers representing the values of coins in your possession, write a function that returns the minimum amount of change (the minimum sum of money) that you cannot create. The given coins can have any positive integer value and aren\'t necessarily unique (i.e., you can have multiple coins of the same value).","permalink":"/docs/easy/non_constructible_change"},{"id":"medium/smallest_difference","title":"Smallest Difference","description":"Write a function that takes in two non-empty arrays of integers, finds the pair of numbers (one from each array) whose absolute difference is closest to zero, and returns an array containing these two numbers, with the number from the first array in the first position.","permalink":"/docs/medium/smallest_difference"},{"id":"easy/sorted_squared_array","title":"Sorted Squared Array","description":"Write a function that takes in a non-empty array of integers that are sorted in ascending order and returns a new array of the same length with the squares of the original integers also sorted in ascending order.","permalink":"/docs/easy/sorted_squared_array"},{"id":"medium/spiral_traverse","title":"Spiral Traverse","description":"Write a function that takes in an n x m two-dimensional array (that can be square-shaped when n == m) and returns a one-dimensional array of all the array\'s elements in spiral order.","permalink":"/docs/medium/spiral_traverse"},{"id":"medium/sweet_and_savory","title":"Sweet And Savory","description":"You\'re hosting an event at a food festival and want to showcase the best possible pairing of two dishes from the festival that complement each other\'s flavor profile.","permalink":"/docs/medium/sweet_and_savory"},{"id":"medium/three_number_sum","title":"Three Number Sum","description":"Write a function that takes in a non-empty array of distinct integers and an integer representing a target sum. The function should find all triplets in the array that sum up to the target sum and return a two-dimensional array of all these triplets. The numbers in each triplet should be ordered in ascending order, and the triplets themselves should be ordered in ascending order with respect to the numbers they hold.","permalink":"/docs/medium/three_number_sum"},{"id":"easy/tournament_winner","title":"Tournament Winner","description":"There\'s an algorithms tournament taking place in which teams of programmers compete against each other to solve algorithmic problems as fast as possible. Teams compete in a round robin, where each team faces off against all other teams. Only two teams compete against each other at a time, and for each competition, one team is designated the home team, while the other team is the away team. In each competition there\'s always one winner and one loser; there are no ties. A team receives 3 points if it wins and 0 points if it loses. The winner of the tournament is the team that receives the most amount of points.","permalink":"/docs/easy/tournament_winner"},{"id":"easy/transpose_matrix","title":"Transpose Matrix","description":"You\'re given a 2D array of integers matrix. Write a function that returns the transpose of the matrix.","permalink":"/docs/easy/transpose_matrix"},{"id":"easy/two_number_sum","title":"Two number sum","description":"Write a function that takes in a non-empty array of distinct integers and an integer representing a target sum. If any two numbers in the input array sum up to the target sum, the function should return them in an array, in any order. If no two numbers sum up to the target sum, the function should return an empty array.","permalink":"/docs/easy/two_number_sum"},{"id":"easy/validate_subsequence","title":"Validate Subsequence","description":"Given two non-empty arrays of integers, write a function that determines whether the second array is a subsequence of the first one.","permalink":"/docs/easy/validate_subsequence"},{"id":"medium/zero_sum_subarray","title":"Zero Sum Subarray","description":"You\'re given a list of integers nums. Write a function that returns a boolean representing whether there exists a zero-sum subarray of nums.","permalink":"/docs/medium/zero_sum_subarray"}]}')}}]);